import React from "react";
import { Route, Redirect } from "react-router-dom";

const AppRoute = ({
  component: Component,
  isAuthProtected,
  layout: Layout,
  ...rest
}) => (
  <Route
    {...rest}
    render={(props) => {
      if (isAuthProtected) {
        return <Redirect to={{ pathname: "/login" }} />;
      }

      return (
        <Layout>
          <Component {...props} />
        </Layout>
      );
    }}
  />
);

export default AppRoute;
